import React from "react";
import "../Design/Header.css";
import Logo from "../Images/cs-goLogo.svg";

function Header() {
  return (
    <div>
      <img src={Logo} className="cslg"></img>
      <Link>Home</Link>
      <Link>About us</Link>
      <p>Portfolio</p>
      <p>News</p>
      <p>Contact us</p>
    </div>
  );
}

export default Header;
